import logo from "../assets/images/full-logo.png";

export default function Home() {
  return (
    <div className="page">
      <img src={logo} alt="Ayura Naturals" width="300" />
      <h1>Welcome to Ayura Naturals</h1>
      <p>Authentic Ayurvedic Medical Center & Natural Products</p>
    </div>
  );
}
